$(function(){
	$('.header__morebtn').on('click', function(e){
		e.preventDefault();
	});
	$('.category__menuitem label').on('change', function(){
		$(this).toggleClass('active');
	});
	$('.category__menurange').each(function(){
		var min, max, steep, elementmin, elementmax;
		elementmin = $(this).find('.range_start');
		elementmax = $(this).find('.range_end');
		minimum = +$(this).find('.jrange').attr('data-min');
		maximum = +$(this).find('.jrange').attr('data-max');
		steep = +$(this).find('.jrange').attr('data-steep');
		$(this).find('.range_start').val(minimum);
	    $(this).find('.range_end').val(maximum);
		$(this).find('.jrange').slider({
			range: true,
			min: minimum,
			max: maximum,
			step: steep,
			values: [ minimum, maximum ],
			slide: function( event, ui ) {
	       		var e = document.createEvent('HTMLEvents');                 
	       		e.initEvent('change', true, true);            
	       		elementmin.val(ui.values[ 0 ]);                 
	       		elementmin[0].dispatchEvent(e);            
	       		elementmax.val(ui.values[ 1 ]);                 
	       		elementmax[0].dispatchEvent(e);         
	      	}
		});
		elementmin.on('blur',function(){
			if( +$(this).val() > maximum || +$(this).val() < minimum || +$(this).val()> elementmax.val()){
				$(this).val(minimum);
			}
			var min, max;
			min = +$(this).parent().find('.range_start').val();
			max = +$(this).parent().find('.range_end').val();
			elementmin.parent().parent().find( ".jrange" ).slider( "option", "values", [ min, max ] );
		});
		elementmax.on('blur',function(){
			if( +$(this).val()>maximum || +$(this).val() < minimum || +$(this).val() < elementmin.val()){
				$(this).val(maximum);
			}
			var min, max;
			min = +$(this).parent().find('.range_start').val();
			max = +$(this).parent().find('.range_end').val();
			elementmax.parent().parent().find( ".jrange" ).slider( "option", "values", [ min, max ] );
		});
	});
});

