				$(this).removeClass("active");
				$(this).closest(".abbottom__faq-item").find(".abbottom__faq-body").css('height', 0);
				$(".abbottom__faq-top").removeClass("active");
				$(this).closest(".abbottom__faq-item").removeClass("active");
