$(document).ready(function() {

	$('body').on('click','.fill-out-form__radio > label > input',function() {
		$(this).parents('.fill-out-form__line').find('.fill-out-form__radio > label').removeClass('active');
		$(this).parent().addClass('active');
	});


	$(".file-price").change(function(e){
		var element = $(this);
		if(typeof e.target.files[0] == 'undefined'){
			var fileName = " ..."; 
			element.parent().find('div').text(fileName); 
		}else{ 
			element.parent().find('div').html(this.files[0].name);
		}
	});

	$(".file-present").change(function(e){
		var element = $(this);
		var fileCount = this.files.length;
		if(typeof e.target.files[0] == 'undefined'){ 
			var fileName = " ..."; 
			element.parent().find('div').text(fileName); 
		}else{ 
			if(fileCount === 1) {
				element.parent().find('div').html(this.files[0].name);
			}else{
				if(fileCount === 2) {
					element.parent().find('div').html(this.files[0].name+'<br> '+this.files[1].name);
				}else {
					if(fileCount === 3) {
						element.parent().find('div').html(this.files[0].name+'<br> '+this.files[1].name+'<br> '+this.files[2].name);
					}
				}
			}
		} 
	});

});
