var mapMarker;
$(function(){
	$('[data-star-count]').each(function(){
		var starsCount = +$(this).data('star-count');
		if(starsCount % 2 == 0 && starsCount != 0){
			$(this).find('div').eq((starsCount / 2) - 1).addClass('fill').prevAll().addClass('fill');
		}else{
			if(starsCount != 0){
				$(this).find('div').eq(Math.ceil(starsCount / 2) - 1).addClass('half').prevAll().addClass('fill');
			}
		}
	});
});
